def get_process_time(stats):
    # Method 1: Using list comprehension (most concise)
    t3_minus_t2 = [(row[2] - row[1]) * 1_000_000 for row in stats if row[0] != 999.0]

    print("t3 - t2 differences:")
    print(t3_minus_t2, "usec")

